patricia = User.create({ email: "patricia.deandres@gmail.com", encrypted_password: "123456", first_name: "Patricia", last_name: "DeAndres", age: 33, role: "teacher", zip: "01852", short_bio: "I am a professional flutist.  I currently perform with the Metropolitan Wind Symphony and have performed with Symphony Orchestras across Europe.", lesson_location: "Lowell, MA", password: "123456", profile_photo: "https://bricoflauta.files.wordpress.com/2013/06/patricia-portada.jpg", long_bio: "She started her musical studies in the professional conservatory Arturo Soria in Madrid, Spain, being graduated with Award of Extraordinary Skill and Excellence. After that she continued studying at the Royal Conservatory of Music in Madrid, Spain with the professor Manuel Guerrero obtaining her masters degree in 2012. She has attended masterclasses with well renowned flutists such a Antonio Arias and Miguel Ángel Angulo  (National Orchestra of Spain), Aurèle Nicolet (Berlin Philharmonic) and Stefán R. Höskuldsson  (MET Orchestra and Chicago Symphony orchestra), among others. As an orchestra and chamber music performer she was awarded with Acordes Caja Madrid Award in 2008 and the 1st Prize in First Section of International Music Competition Ciudad de Valencia in 2010 She has performed as a soloist in the National Music Hall of Spain and as orchestra player in the Music Palace of Valencia as well as the most important music halls in Spain. As a chamber music player she was invited to perform in the Stenway Series with pianist Roberto Berrocal, Lowell Folk Festival with flutist Geraldine Morillo and has collaborated for miscellaneous projects by musicians of the Boston Symphony and Boston Pops. She has been invited to perform with the Metropolitan Wind Symphony. Patricia has also a bachelor degree in History of Art, a postgraduate diploma in Curation of Heritage by for the Autonoma University of Madrid and have been part of the management staff in the Prado Museum in Madrid, Spain. She has worked for Arista Flutes as an office manager, brand ambassador and flute maker, making professional-level handmade flutes and headjoints in silver, gold and platinum. Since April 2017 she works for Powell Flutes as a key stringer, activity that she combines with performing and teaching. "})
mark = User.create({ email: "mark.taddonio@gmail.com", encrypted_password: "123456", first_name: "Mark", last_name: "Taddonio", age: 25, role: "teacher", zip: "03087", short_bio: "I am the current band director at Windham High School.  I am primarily a trombonist, but can teach all wind and brass instruments as well as voice.  I have been teaching professionally for five years and am excited to have you as a student!", lesson_location: "Windham, NH", password: "123456", profile_photo: "https://static.wixstatic.com/media/7ade00_c4d0f32766bb4767917d107f5e700be0~mv2.png/v1/fill/w_320,h_400,al_c,q_80/7ade00_c4d0f32766bb4767917d107f5e700be0~mv2.webp", long_bio: "Mark Taddonio has been with the Windham School District since 2015, initially as an Associate Director of Bands, and now as the Director of Bands at Windham High School. Mark oversees the Concert Band, Pep Band, Honors Jazz Ensemble, and Honors Windham Ensemble. Additionally, he teaches AP Music Theory and Guitar. Mark is a graduate of the University of New Hampshire where he earned his Bachelor of Music Education, cum laude. During this time he studied jazz and classical trombone while taking part in many different performing ensembles in addition to courses in music, pedagogy, education, and philosophy.  Mark is a very active freelance musician across New Hampshire and northern Massachusetts. He can be regularly heard playing with the Tall Granite Big Band, the Pocket Big Band, the Scott Spradling Band, Gretchen and the Pickpockets, as well as various pit orchestra and chamber groups. A brass specialist, he occasionally performs on euphonium, bass trombone, French horn, and trumpet."})
sheila = User.create({ email: "sheila.cuneo@gmail.com", encrypted_password: "123456", first_name: "Sheila", last_name: "Cuneo", age: 50, role: "teacher", zip: "03087", short_bio: "I am the current choir director at Windham High School.  I am primarily a vocalist and teach all voices.", lesson_location: "Windham, NH", password: "123456", long_bio: "Sheila Cuneo has been teaching music for the past thirteen years in the Windham School District. She began teaching at the Windham Middle School as the chorus director and music appreciation instructor. She was also the director for the Select Choir. During her tenure at the Middle School, she also directed four musicals and was the vocal coach for most of the musical productions throughout her time there. In 2012, Sheila moved to the High School where she is currently the Director of Choirs and teacher for all the music electives, including guitar, piano, music and media, percussion and music theory. She has also been vocal coach for the musicals, including the Phantom of the Opera, which was the production the year before she joined the staff at Windham High School. Since then she has enjoyed working closely with the drama director in both rehearsal and performance. The WHS Choir has had the opportunity to travel to New York where the students participated in a workshop with Dr. Cindy Bell from Hofstra University. We continued on into New York City where students were part of a Broadway workshop with Broadway actor and singer, Jason Forbach who later performed in a lead roll of Les Miserables. Currently, the WHS choir is planning an exciting trip to Canada where they will perform for the Mayor of Quebec and the Governor of Montreal. They will also have a special performance in the Basilica De Notre Dame in Quebec. Outside of Sheilas teaching responsibilities, she has been a member of several different community and church choirs throughout the state performing as both soloist and choral director. She has also taught both flute and voice privately. In 2004, she had the opportunity to perform with the St. Annes Choir of Hampstead by special invitation at a High Mass in the Vatican City, Rome. She also performed as soloist in the Santa Maria Church, Rome, Italy during that same trip. She has also coached several students who have earned their way into both Jazz and Classical All-State Festivals.", profile_photo: "data:image/jpeg;base64,",})
